function leftButton() {
  var val = document.getElementById('cdrSlide').value;
  if (val > 0) {
    document.getElementById('cdrSlide').value = document.getElementById('cdrSlide').value - 100;
    document.getElementById('cdrBox').value = document.getElementById('cdrBox').value - 100;
  } else if (val < 0) {
    document.getElementById('cdrSlide').value = 0;
    document.getElementById('cdrBox').value = 0;
  }
}

function rightButton() {
  var currentValue = parseInt(document.getElementById('cdrBox').value, 10);
  var val = document.getElementById('cdrBox').value;
  if (val < 4500) {
    currentValue += 100;
    val = currentValue;
    document.getElementById('cdrSlide').value = currentValue;
    document.getElementById('cdrBox').value = currentValue;
    if (currentValue > 4500) {
      currentValue = 4500;
      document.getElementById('cdrSlide').value = 4500;
      document.getElementById('cdrBox').value = 4500;

    }
  }
}

function updateTextInput(val) {
  document.getElementById('cdrBox').value = val;
}

function updateSlideInput(val) {
  if (val > 4500) {
    val = 4500;
    alert("Please select a value between 0 and 4500");
    document.getElementById('cdrBox').value = val;
  }
  if (val < 0) {
    val = 0;
    alert("Please select a value between 0 and 4500");
    document.getElementById('cdrBox').value = val;
  }
  return document.getElementById('cdrSlide').value = val;
}

function round(num) {
  var multiplier = Math.pow(10, 3);
  return Math.round(num * multiplier) / 1000;
}

